import React from 'react';

export default class Nesting extends React.Component {
  render() {
    const parents = this.props.goal.childTo.map((parent) => {return <li>{parent.owner.name}</li>;});
    const children = this.props.goal.parentTo.map((child) => {return <li>{child.owner.name}</li>;});
    return (
      <div>
        {parents.length > 0 && <h3>Child to:</h3>}
        {parents}
        {children.length > 0 && <h3>Parent to:</h3>}
        {children}
      </div>
    )
  }
}
